import React from 'react';
import axios from 'axios';
import Produto from './Produto'
import './index.css';
export default class Container extends React.Component {

  constructor(props){
    super(props);
    this.state = {
      listaProdutos: []
    }
  }

  componentWillMount() {
    /* 
    * /estoque
    */
   axios.get('https://api.github.com/emojis')
   .then(response => {
     console.log(response.data);
     this.setState({listaProdutos: ['felie', 'cassio', 'larissa']});

   }).catch(erro => console.log(erro))
  }

  render() {
    return (
        <div>
            {this.state.listaProdutos.map(produto => <Produto key={produto} nome={produto} />)}
        </div>
    );
  }
}
